import React from 'react'

function VendorScreen() {
    return (
        <div style={{marginTop: 30, textAlign:'center'}}>
           <h1 style={{marginTop: 30, textAlign:'center'}}><strong style={{color:'red'}}>403 </strong>Forbidden !!</h1> <h4 style={{ marginTop:20, textAlign:'center'}}>Sorry, You are not allowed to access this page.</h4>
           <img src='https://freefrontend.com/assets/img/403-forbidden-html-templates/The-Bouncer-at-403-Page.gif'
           style={{height: 300, width: 500, marginTop:30}}></img>
        </div>
    )
}

export default VendorScreen
